package Token;

public class SwapNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a=10, b=30;
System.out.println("before swaping");
System.out.println("a="+a);
System.out.println("b="+b);
int c;
c=b;
b=a;
a=c;

System.out.println("after swaping");
System.out.println("a="+a);
System.out.println("b="+b);



	}

}
